import style from './Contacts.module.css'

const Contacts = (props) => {
    return (
        <div className={style.contactsBlock}>
            <a name='contacts'></a>
            <h3>Contacts</h3>
            <div className={style.contact}>
                <p>Ukraine, Lviv</p>
                <p>GitHub: <a href="https://github.com/fliuntyurii">click</a></p>
            </div>
        </div>
    )
}

export default Contacts;
